-- ----------------------------
-- Table structure for `bus_line`
-- ----------------------------
DROP TABLE IF EXISTS `bus_line`;
CREATE TABLE `bus_line` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_id` int(11) NOT NULL COMMENT '基础平台线路ID',
  `city_id` int(11) NOT NULL COMMENT '城市id',
  `linkdir` tinyint(4) NOT NULL COMMENT '线路方向 0上行 1下行 2内环 3外环',
  `line_name` varchar(50) NOT NULL COMMENT '线路名称',
  `line_name_bd` varchar(255) DEFAULT NULL COMMENT '百度采集线路名',
  `price` int(20) DEFAULT NULL COMMENT '公交车起步价格,单位默认分',
  `start_time` varchar(45) DEFAULT NULL COMMENT '公家车发车时间',
  `end_time` varchar(45) DEFAULT NULL COMMENT '公交车运营结束时间',
  `line_type` varchar(6) DEFAULT 'C' COMMENT '线路等级，默认C，其他级别',
  `dictionary_id` int(11) DEFAULT NULL COMMENT '字典的id号',
  `installation_number` int(6) DEFAULT '0' COMMENT '设备安装数',
  `match_number` int(6) DEFAULT '0' COMMENT '配车数',
  `user_id` int(8) DEFAULT NULL COMMENT '用户id',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `linegeo` text COMMENT '所有站点经纬度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=72 DEFAULT CHARSET=utf8 COMMENT='线路表关联基础库的线路表';

