-- Records of bus_line
-- ----------------------------

-- ----------------------------
-- Table structure for `bus_stop`
-- ----------------------------
DROP TABLE IF EXISTS `bus_stop`;
CREATE TABLE `bus_stop` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `stop_name` varchar(255) DEFAULT NULL COMMENT '站点名字',
  `line_id` int(8) DEFAULT NULL COMMENT '线路id',
  `stopseq` int(8) DEFAULT NULL COMMENT '站点所在线路的第几站',
  `linedir` int(11) DEFAULT NULL COMMENT '上行或者下行；0：上行；1：下行',
  `blat` varchar(255) DEFAULT NULL COMMENT '百度维度',
  `blon` varchar(255) DEFAULT NULL COMMENT '百度经度',
  `lat` varchar(255) DEFAULT NULL COMMENT 'gps维度',
  `lon` varchar(255) DEFAULT NULL COMMENT 'gps经度',
  `stop_type` varchar(255) DEFAULT 'C' COMMENT '站点的等级，默认级别为C级别',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3541 DEFAULT CHARSET=utf8 COMMENT='站点信息表';

